            info,error,code = system_command('zsign -k '+filename+'.p12 -p '+password+' -m '+filename+'.mobileprovision -j -b '+bundleid+' -n '+appname+' -o '+targetfile+' -z 4 -y 3kksjfkljskduisjf((UifdiousifklhlkjsfjjKJ:JJ5646)6jjkljhuIU) ./tmp/ipafile')
